import React from "react";

// export a home page component
export default class Items extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        listitems: ["a", ["b", "b"], "c"]
    };
  }

  render() {
    return (
        <div className="listitem">
        {this.state.listitems.map(listitem => (
          <div className="listitem">
            {listitem}
          </div>
        ))}
      </div>
        );
  }
}
